import Header from '../components/Header';
import SignUp from '../components/SignUp';
import Footer from '../components/Footer';
import LearningCards from '../components/LearningCards';

function Learn() {
    return (
        <div>
            <Header />
            <LearningCards />
            <SignUp />
            <Footer />
        </div>
    )
}
  
export default Learn
